import React, { Component } from 'react';
import { Button, Typography } from '@material-ui/core';
import './navbar.css';

class Navbar extends Component {
  navigateTo(page) {
    window.location.href = page;
  }

  render() {
    let pathname = window.location.pathname;
    console.log(pathname);
    return (
      <div id="navbar-container">
        <Typography id="navbar-title-container" variant="h2">
          NATALIE WAGNER
        </Typography>
        <div id="navbar-buttons-container">
          <Button selected={true} onClick={() => this.navigateTo('index.html').bind(this)}>
            Home
          </Button>
          <Button onClick={() => this.navigateTo('quiz.html').bind(this)}>
            Quiz
          </Button>
          <Button onClick={() => this.navigateTo('links.html').bind(this)}>
            My Links
          </Button>
          <Button onClick={() => this.navigateTo('emailnatalie.html').bind(this)}>
            Email Me
          </Button>
        </div>
      </div>
    );
  }
}

export default Navbar;
